import { React, useEffect, useState } from 'react';
function SamList(props) {
    const [isdote, setisdote] = useState(false);
    function handleClickdote() {
        if (props.type === 2) {
            if (isdote) {
                document.getElementById('2').classList.remove('d-none');
                setisdote(true);
            } else {
                document.getElementById('2').classLista.dd('d-none');
                setisdote(false);
            }
        }
    }
    return (
        <div className="row col-12 p-3 pe-4 pt-5">
            <div className="col-12 d-flex flex-column justify-content-start">
                {props.item_list.map((item) => (
                    <React.Fragment key={item.key}>
                        <button onClick={() => { props.setType(item.type); handleClickdote(); }} className={`row my-1 p-2 border-1 border-light  rounded-2 ${props.isDarkMode ? "bg-dark text-light" : "bg-light text-dark"} bg-opacity-50 navitem`}>
                            <img src={item.imgsrc} alt={item.imgalt} className='col-3' />
                            <h6 className='col-9 m-0 p-0'>{item.text}</h6>
                        </button>
                        {
                            item.type === 2 &&
                            <div className='col-12 d-none' id='2'>
                                <button onClick={() => props.setType(item.type)} className={`col-6 my-1 p-2 border-1 border-light  rounded-2 ${props.isDarkMode ? "bg-dark text-light" : "bg-light text-dark"} bg-opacity-50 navitem`}>
                                    <img src={item.imgsrc} alt={item.imgalt} className='col-3' />
                                    <h6 className='col-9 m-0 p-0'></h6>
                                </button>
                                <button onClick={() => props.setType(item.type)} className={`col-6 my-1 p-2 border-1 border-light  rounded-2 ${props.isDarkMode ? "bg-dark text-light" : "bg-light text-dark"} bg-opacity-50 navitem`}>
                                    <img src={item.imgsrc} alt={item.imgalt} className='col-3' />
                                    <h6 className='col-9 m-0 p-0'></h6>
                                </button>
                            </div>
                        }
                    </React.Fragment>
                ))}
            </div>
        </div >
    );
}

export default SamList;
